import './App.css';
import Home from './Components/Home';
import Footer from './Components/Layout/Footer';
import Header from './Components/Layout/Header';
function App() {
  return (
    <div className="App">
      <Header />
      <div className='container container-fluid'>
      <Home />
      </div>
      <Footer />
    </div>
  );
}

export default App;
